import React from "react";

export const SavingsCard = () => {
  return (
    <div>
      <h2>Type: Tie in type of savings</h2>
      <h2>Location: Tie in location</h2>
      <h2>Ammount: Tie in ammount</h2>
      <h2>Note: Tie in note</h2>
    </div>
  );
};
